div.div:
Оки, на "первой" лекции затронули много чего.
Выяснили особенности типизации языка, сравнили ее с другими языками.
Разобрали базовую программу на C++, залезли во внутренности, чтобы дать представление о том, что на самом деле происходит внутри. Это поможет в дальнейшем лучше воспринимать сам язык.
В следующей лекции перейдем к более простым концепциям, а именно:
базовый синтаксис;
тривильные типы, виды переменных;
функции
работа компилятора - препроцессинг, компиляция, линковка;
управление ходом программы, условия, циклы;
работа с заголовочными файлами
литералы
void
работа с консолью
